Let \[f(n) =
\begin{cases}
n^2-1 & \text{ if }n < 4,
\\ 3n-2 & \text{ if }n \geq 4.
\end{cases}
\]Find $f(f(f(2)))$.

A line with slope equal to $1$ and a line with slope equal to $2$ intersect at the point $P(1,6),$ as shown. [asy]
unitsize(0.5 cm);
draw((0,-1)--(0,10),EndArrow);
draw((-10,0)--(5,0),EndArrow);
draw((-6,-1)--(5,10),linewidth(0.8));
draw((-2.5,-1)--(3,10),linewidth(0.8));
label("$x$",(5,0),E);
label("$y$",(0,10),N);
label("$P(1,6)$",(1,6),SE);
label("$Q$",(-5,0),NW);
label("$R$",(-2,0),SE);
[/asy]What is the area of $\triangle PQR?$

Let \[f(x) = \left\{
\begin{array}{cl}
\sqrt{x} &\text{ if }x>4, \\
x^2 &\text{ if }x \le 4.
\end{array}
\right.\]Find $f(f(f(2)))$.

Below is a portion of the graph of a function, $y=p(x)$:

[asy]
import graph; size(6cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-3.5,xmax=3.5,ymin=-4.25,ymax=6.25;

pen cqcqcq=rgb(0.75,0.75,0.75);
/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return sgn(2x-2)*abs(2x-2)^(1/3)+2*sgn(2x-2)*abs(2x-2)^(1/5)+abs(2x-2)^(1/7);}
draw(graph(f1,xmin,xmax),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=p(x)$",(xmax+0.25,f1(xmax)),E);
[/asy]

